package scraping.gookmin;

import java.util.HashMap;
import java.util.Map;

public class Key {
    public Map<Integer, String> keys = new HashMap<>();
    public Map<Integer, Integer> positions = new HashMap<>();
    public Map<Integer, String> hashes = new HashMap<>();

    public Key() {
        this.keys.put(1, "");
        this.keys.put(2, "");
        this.keys.put(3, "");
        this.keys.put(4, "");
        this.keys.put(5, "");
        this.keys.put(6, "");
        this.keys.put(7, "");
        this.keys.put(8, "");
        this.keys.put(9, "");
        this.keys.put(0, "");

    }

    public void saveHashes(int position, String hash) {
        hashes.put(position, hash);
    }

    public void savePosition(String s, int position) {
        positions.put(getKey(s), position);
    }

    public String getHash(int position) {
        return hashes.get(position);
    }

    private int getKey(String s) {
        for (Map.Entry<Integer, String> entry : keys.entrySet()) {
            if (s.equals(entry.getValue())) return entry.getKey();
        }
        throw new IllegalArgumentException("not valid key");
    }
}
